    "Water quality assessment of razorback sucker grow-out ponds",nt"tracking_summary":
    {ntt"total": 15,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T22:42:28.710728",nt"name": "water-quality-assessment-of-razorback-sucker-grow-out-ponds",nt"isopen":
    false,nt"url": null,nt"notes": "Water quality parameters had never been
    assessed in these grow-out ponds. Historically growth, condition, and survival of
    razorback suckers have been variable between ponds. Because of elevated selenium
    concentrations previously found in many Grand Valley ponds and wetlands, we had
    concerns of elevated selenium in grow-out ponds. The purpose of this study was to
    describe water quality conditions and food supplies in 16 grow-out ponds in western
    Colorado that are currently being used by the CRRP to propagate juvenile endangered
    razorback suckers, and to identify any water quality parameters which may limit
    growth, condition, and survival of razorback suckers in both the grow-out ponds
    and after stocking into the Colorado and Gunnison rivers. Selenium was the trace
    element of greatest concern, and toxicity guidelines were exceeded in water, sediment,
    dietary items, and razorback sucker muscle plugs from several ponds (most notably
    Maggio and Clymers ponds), indicating increased risk of reproductive impairment
    (Lemly 1996). Stocked razorback suckers recaptured from the rivers at least 8 months
    post-stocking still retained high selenium tissue residues acquired from the grow-out
    ponds. River-stocked razorback suckers had significantly higher selenium concentrations
    than native bluehead suckers (Catostomus discobolus) and native flannelmouth suckers
    (Catostomus latipinnis) collected in the Colorado and Gunnison Rivers in the Grand
    Valley. The levels of selenium we found in razorback suckers are likely reproductively
    problematic (Lemly 1996). Management recommendations for grow-out ponds are presented
    to improve survival and condition of razorback suckers.",nt"license_title":
